import React from 'react'
import './assets/css/style.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useSelector } from 'react-redux';
import MovieOne from './components/MovieOne';
import MovieTwo from './components/MovieTwo';
import MovieTre from './components/MovieTre';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';



function App() {
  const state = useSelector(state => state)
  const movieone = state.movie_one.initialState;

  console.log(movieone)
  return (
    <Router>


      <Switch>
        <Route path="/" component={MovieOne} data={movieone} />
        <Route path="/" component={MovieTwo} data={movieone} />
        <Route path="/" component={MovieTre} data={movieone} />
      </Switch>


    </Router>

  )
}
export default App;
